    [],nt"revision_timestamp": "2016-05-31T01:08:35.031133",nt"name": "afsc-race-gap-conrath-delayed-discard-mortality-of-the-north-pacific-giant-octopus",nt"isopen":
    false,nt"url": null,nt"notes": "The majority of octopus bycatch occurs
    in Pacific cod pot fisheries and recent data collected by North Pacific Groundfish
    Observers indicate that immediate mortality of octopus caught in these fisheries
    is very small. The objectives of the proposed research were to examine the delayed
    mortality of E. dofleini captured in Pacific cod pot fisheries. These data are necessary
    to make sound management decisions for octopus based on appropriate scientific information.
     This data set contains observations and measurements on the condition, weight,
    and survivorship of North Pacific giant octopus that were caught as bycatch in commercial
    fishing operations utilizing pot gear to target Pacific cod. These octopus were
    captured during commercial fishing operations that occurred during three fishing
    seasons from January 2014 through February 2015. These commercial fishing operations
    occurred in the central Gulf of Alaska in either Shelikof Strait or Marmot Bay.
    Data collected included information on octopus condition, size, sex, and injury
    presence. Other data collected included the location of capture, water depth, octopus
    air exposure time, water temperature, and gear soak time. These octopus were transported
    to the Kodiak sea water facility and held for a period of several months. During
    this period data were collected on condition, injury presence, and survivorship
    at 21 days. After this period octopus were held for an additional five to six weeks
    to assess growth within the laboratory. Octopus were fed to satiation every 72 hours
    during this period. Food was weighed prior to feeding and remaining food was weighed
    after a four hour period. The final food weight was corrected for water soaking
    time. Octopus were weighed once per week during this period of time. Several metrics
    of octopus feeding and growth were measured after this period including specific
    growth rate, absolute growth rate, absolute feeding rate, specific feeding rate,
    feeding efficiency, and daily growth rate.  ",nt"license_title": null,nt"extras":
